<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Float Boat Animation</title>

    <style>
      * {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
      }

      .parentDiv {
        min-height: 100vh;
        display: grid;
        place-items: center;
      }

      .wrapper {
        width: 100%;
        max-width: 1080px;
      }

      #wave-1 {
        stroke-dasharray: 91.45633697509766;
        stroke-dashoffset: 91.45633697509766;
        animation: wave1 6s ease-in-out infinite;
      }

      @keyframes wave1 {
        0% {
          stroke-dashoffset: 91.45633697509766;
        }

        45%,
        55% {
          stroke-dashoffset: 0;
        }

        100% {
          stroke-dashoffset: -91.45633697509766;
        }
      }

      #wave-2 {
        stroke-dasharray: 91.45634460449219;
        stroke-dashoffset: 91.45634460449219;
        animation: wave2 6s ease-in-out 1s infinite;
      }

      @keyframes wave2 {
        0% {
          stroke-dashoffset: 91.45634460449219;
        }

        45%,
        55% {
          stroke-dashoffset: 0;
        }

        100% {
          stroke-dashoffset: -91.45634460449219;
        }
      }

      #wave-3 {
        stroke-dasharray: 91.45635223388672;
        stroke-dashoffset: 91.45635223388672;
        animation: wave3 6s ease-in-out 3s infinite;
      }

      @keyframes wave3 {
        0% {
          stroke-dashoffset: 91.45635223388672;
        }

        45%,
        55% {
          stroke-dashoffset: 0;
        }

        100% {
          stroke-dashoffset: -91.45635223388672;
        }
      }

      #wave-4 {
        stroke-dasharray: 91.45635223388672;
        stroke-dashoffset: 91.45635223388672;
        animation: wave4 6s ease-in-out 2s infinite;
      }

      @keyframes wave4 {
        0% {
          stroke-dashoffset: 91.45635223388672;
        }

        45%,
        55% {
          stroke-dashoffset: 0;
        }

        100% {
          stroke-dashoffset: -91.45635223388672;
        }
      }

      #wave-5 {
        stroke-dasharray: 91.45637512207031;
        stroke-dashoffset: 91.45637512207031;
        animation: wave5 6s ease-in-out 5s infinite;
      }

      @keyframes wave5 {
        0% {
          stroke-dashoffset: 91.45637512207031;
        }

        45%,
        55% {
          stroke-dashoffset: 0;
        }

        100% {
          stroke-dashoffset: -91.45637512207031;
        }
      }

      #wave-6 {
        stroke-dasharray: 91.45639038085938;
        stroke-dashoffset: 91.45639038085938;
        animation: wave6 6s ease-in-out 4s infinite;
      }

      @keyframes wave6 {
        0% {
          stroke-dashoffset: 91.45639038085938;
        }

        45%,
        55% {
          stroke-dashoffset: 0;
        }

        100% {
          stroke-dashoffset: -91.45639038085938;
        }
      }

      #boat {
        transform-box: fill-box;
        transform-origin: center top;
        transform: rotate(-25deg) translate(15px, -15px);
        animation: boat 8s ease-in-out forwards;
      }

      @keyframes boat {
        0% {
          transform: rotate(-25deg) translate(15px, -15px);
        }

        50%,
        60% {
          transform: rotate(0deg) translate(-50px, 50px);
        }

        100% {
          transform: rotate(0deg) translate(-100px, 50px);
        }
      }

      #floating-boat {
        transform-origin: center bottom;
        transform-box: fill-box;
        transform: rotate(3deg);
        animation: wiggle 4s ease-in-out 4s alternate infinite;
      }

      @keyframes wiggle {
        0% {
          transform: rotate(3deg);
        }

        100% {
          transform: rotate(-3deg);
        }
      }

      #cloud-1 {
        transform-origin: center;
        transform-box: fill-box;
        animation: move 20s linear infinite;
      }

      #cloud-2 {
        transform-origin: center;
        transform-box: fill-box;
        animation: move 40s linear infinite;
      }

      #cloud-3 {
        transform-origin: center;
        transform-box: fill-box;
        animation: move 60s linear infinite;
      }

      @keyframes move {
        0% {
          opacity: 0;
          transform: translateX(-100px);
        }

        5% {
          opacity: 1;
        }

        95%,
        100% {
          opacity: 0;
          transform: translateX(100px);
        }
      }

      #left-forearm {
        transform-origin: 55px 35px;
        transform-box: fill-box;
        animation: leftFore 2s ease-in-out forwards;
      }

      @keyframes leftFore {
        0% {
          transform: rotate(0deg);
        }

        100% {
          transform: rotate(-1.5deg);
        }
      }

      #left-hand {
        transform-origin: 295px 56px;
        transform-box: fill-box;
        animation: leftHand 2s ease-in-out forwards;
      }

      @keyframes leftHand {
        0% {
          transform: rotate(0deg);
        }

        100% {
          transform: rotate(-5deg);
        }
      }

      #right-hand {
        transform-origin: 45px 33px;
        transform-box: fill-box;
        animation: rightFore 2s ease-in-out forwards;
      }

      @keyframes rightFore {
        0% {
          transform: rotate(0deg);
        }

        100% {
          transform: rotate(-3deg);
        }
      }

      #right-forearm {
        transform-origin: 196px 30px;
        transform-box: fill-box;
        animation: rightHand 2s ease-in-out forwards;
      }

      @keyframes rightHand {
        0% {
          transform: rotate(0deg);
        }

        100% {
          transform: rotate(-4deg);
        }
      }

      #eye-1,
      #eye-2 {
        transform-box: fill-box;
        transform-origin: center;
        animation: wink 4s ease-in-out infinite alternate;
      }

      @keyframes wink {
        0%,
        45% {
          transform: scaleY(1);
        }

        50% {
          transform: scaleY(0);
        }

        55%,
        100% {
          transform: scaleY(1);
        }
      }
    </style>
  </head>
